    return (
    <div>
    <h1>Hello React Component</h1>
    <h2>学习react 最重要的是心态要好</h2>
    <Home />
    <Mynav nav={ nav1 }/>
    <Mynav nav={ nav2 }/>
    </div>
      )
  }
}


export default App
